{"source":{"uri":"features/specs/categorias.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal\nFuncionalidade: Webmotors Web\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @categorias\n  Cenário: Categorias\n    Quando seleciono uma das categorias\n    Então vejo a lista de veiculos da categoria selecionada","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_agendar_chamada.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @detalhe\nFuncionalidade: Validar agendamento de chamada de video\n  Eu como Usuario\n  Quero agendar uma chamada de video\n  Para ter mais informações do anuncio\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @agendar_chamada_video\n  Esquema do Cenário: Validar agendamento de chamada de video\n    Quando desejo agendar uma video chamada\n    E informo o \"<Nome>\", \"<Email>\" e \"<Telefone>\" para agendar\n    E seleciono período\n    Então exibe mensagem de que foi agendado\n    Exemplos:\n    | Nome | Email         | Telefone    |\n    | Ana  | ana@gmail.com | 14999999999 |\n\n  @agendar_chamada_video_fail\n  Esquema do Cenário: Validar agendamento de chamada de video dados invalidos\n    Quando desejo agendar uma video chamada\n    E informo o \"<Nome>\", \"<Email>\" e \"<Telefone>\" para agendar\n    E seleciono período\n    Então fico impossibilitado de continuar\n    Exemplos:\n    | Nome | Email          | Telefone    |\n    | Ana  | ana##gmail.com | 14999999999 |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_carros_vendedor.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @detalhe\nFuncionalidade: Verificar anuncios de um mesmo vendedor\n  Eu como Usuario \n  Quero verificar todos os anuncios de um vendedor\n  Para escolher a melhor opção\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @anuncios_vendedor\n  Cenário: \n    Quando verifico todos anuncios de um vendedor\n    Entao sou redirecionado para a lista de anuncios\n ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_favorito.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @busca\nFuncionalidade: Validar favorito logado\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para favoritar um anuncio de minha preferência\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @favoritos_logado\n  Esquema do Cenário: Validar favorito logado web\n    E faço login como \"automacaoportal@gmail.com\" e \"Webmotors.2022\"\n    Quando realizar a busca do carro \"<modelo>\"\n    E seleciono um anúncio\n    E desejo favoritar\n    Entao o anuncio é favoritado\n    Exemplos:\n    | modelo     |\n    | Honda      |\n    | Fiat       |\n    | Chevrolet  |\n    # | Ford       |\n    # | Hyundai    |\n    # | Peugeot    |\n    # | Volkswagen |\n    # | Renault    |\n\n  @favoritos_deslogado\n  Cenário: Validar favorito deslogado\n    Quando realizar a busca do carro \"<modelo>\"\n    E desejo adicionar aos favoritos\n    E realizo login como \"automacaoportal@gmail.com\" e \"Webmotors.2022\"\n    E adiciono aos favoritos\n    Entao vejo o anuncio favoritado\n    Exemplos:\n    | modelo     |\n    | Honda      |\n    | Fiat       |\n    | Chevrolet  |\n    # | Ford       |\n    # | Hyundai    |\n    # | Peugeot    |\n    # | Volkswagen |\n    # | Renault    |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_financiamento.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @detalhe\nFuncionalidade: Validar simulação de financiamento\n  Eu como Usuario\n  Quero simular um financiamento\n  Para escolher a melhor opção de pagamento\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @financiamento\n  Esquema do Cenário: Simular financiamento\n    E faço a busca por um \"<modelo>\"\n    E seleciono um anúncio\n    Quando preencho o formulário para consulta\n    E decido ver parcelas avisando\n    Entao deve #VERIFICAR RESULTADO DO FINANCIMANETO EM HOMOLOGAÇÃO\n    Exemplos:\n    | modelo |\n    | Honda  |\n\n  @financiamento_sem_avisar\n  Esquema do Cenário: Simular financiamento sem avisar\n    E faço a busca por um \"<modelo>\"\n    E seleciono um anúncio\n    Quando preencho o formulário para consulta\n    E decido não avisar\n    Entao deve #VERIFICAR RESULTADO DO FINANCIMANETO EM HOMOLOGAÇÃO\n    Exemplos:\n    | modelo |\n    | Honda  |\n\n  @financiamento_falha\n  Esquema do Cenário: Simular financiamento\n    E faço a busca por um \"Honda\"\n    E seleciono um anúncio\n    Quando não preencho todos os campos\n    | nome         | email         | telefone         | nascimento         | cpf         | estado         |\n    | <nome_input> | <email_input> | <telefone_input> | <nascimento_input> | <cpf_input> | <estado_input> |\n    Entao o botão fica desabilitado\n    Exemplos:\n    | nome_input | email_input     | telefone_input | nascimento_input | cpf_input   | estado_input        |\n    |            | teste@teste.com | 14999999999    | 01/01/1990       | 02130822339 | São Paulo           |\n    | Testador   |                 | 14999999999    | 01/01/1990       | 02130822339 | São Paulo           |\n    | Testador   | teste@teste.com |                | 01/01/1990       | 02130822339 | São Paulo           |\n    | Testador   | teste@teste.com | 14999999999    |                  | 02130822339 | São Paulo           |\n    | Testador   | teste@teste.com | 14999999999    | 01/01/1990       |             | São Paulo           |\n    | Testador   | teste@teste.com | 14999999999    | 01/01/1990       | 02130822339 | Selecione um estado |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_lead.feature","data":"# encoding: utf-8\n# language: pt\n\n#VERIFICAR RESULTADO DE SUCESSO DO FINANCIMANETO EM HOMOLOGAÇÃO\n#VERIFICAR COM TIME DE FINANCIAMENTO PARA PEGAR OS DADOS QUE PASSAM NAS PARCELAS\n\n@portal @detalhe @lead\nFuncionalidade: Validar envio lead\n  Eu como Usuario\n  Quero enviar uma notificação de interesse\n  Para que o vendedor entre em contato\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @envio_lead\n  Esquema do Cenário: Enviar lead já preenchido\n    E faço a busca por um \"<modelo>\"\n    E seleciono um anúncio\n    Quando envio mensagem do lead\n    Então recebo a confirmação\n    Exemplos:\n    | modelo |\n    | Honda  |\n\n  @lead_falha\n  Esquema do Cenário: Lead sem preencher os campos\n    E faço a busca por um \"Honda\"\n    E seleciono um anúncio\n    Quando preencho somente alguns campos:\n    | nome         | email         | telefone         | mensagem         |\n    | <nome_input> | <email_input> | <telefone_input> | <mensagem_input> |\n    Então não posso enviar a mensagem, pois o botão fica desabilitado\n    Exemplos:\n    | nome_input | email_input       | telefone_input | mensagem_input    |\n    |            | testes@testes.com | 14999999999    | Mensagem de teste |\n    | Testes     |                   | 14999999999    | Mensagem de teste |\n    | Testes     | testes@testes.com |                | Mensagem de teste |\n    | Testes     | testes@testes.com | 14999999999    |                   |\n\n  @denunciar_anuncio\n  Esquema do Cenário: Denunciar um anuncio\n    E faço a busca por um \"<modelo>\"\n    E seleciono um anúncio\n    Quando denuncio um anúncio\n    E preencho o formulario\n    Entao exibe mensagem enviada com sucesso\n    Exemplos:\n    | modelo |\n    | Honda  |\n\n  #denuncia: validar formulario completo","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/filtros_carros.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @filtro_carros\nFuncionalidade: Webmotors Web\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para encontrar os meus futuros veículos\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @filtrar_veiculo\n  Cenário: Filtrar veiculo\n    Quando entro para ver as ofertas\n    E faço um filtro por, marca, modelo e versão\n    Entao devo ver a lista com filtros aplicados\n\n  @validar_filtros_carro\n  Cenário: Filtros Adicionais\n    Quando entro para ver as ofertas\n    E seleciono uma marca e aplico alguns filtros\n    Então retorna a busca com os filtros","mediaType":"text/x.cucumber.gherkin+plain"}},

{"source":{"uri":"features/specs/menus/menu_vender.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @menus_vender\nFuncionalidade: Webmotors Web\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para conseguir vender\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @vender_carro \n  Cenário: Vender Carro\n    Quando quero vender um carro\n    Entao sou redirecionado para anunciar o veiculo\n\n  @vender_moto\n  Cenário: Vender Moto\n    Quando quero vender uma moto\n    Entao sou redirecionado para anunciar a moto\n\n  @menu_vender_deslogado\n  Esquema do Cenário: Acessar Menu Superior para Vender\n    Quando quero acessar o \"<menu>\" superior para vender\n    Entao sou redirecionado para a página do \"<menu>\" escolhido\n    Exemplos:\n    | menu                  |\n    | Vender meu veículo    |\n    | Vender minha moto     |\n    #| Autopago                | Tomando erro 404\n    | Gerenciar meu anúncio |\n    #| FazTudo               | A página não carrega em modo teste\n\n  @menu_vender_logado\n  Esquema do Cenário: Estando Logado Acessar Menu Superior para Vender\n    E faço login com \"automacaoportal@gmail.com\" e \"Webmotors.2022\"\n    Quando quero acessar o \"<menu>\" superior para vender\n    Entao sou redirecionado para a página do \"<menu>\" escolhido\n    Exemplos:\n    | menu                  |\n    | Vender meu veículo    |\n    | Vender minha moto     |\n    #| Autopago                | Tomando erro 404\n    | Gerenciar meu anúncio |\n    #| FazTudo               | A página não carrega em modo teste","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/pesquisar_motos.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal\nFuncionalidade: Webmotors Web\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para encontrar os meus futuros veículos\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @pesquisar_moto\n  Esquema do Cenário: Pesquisa moto\n    Quando que eu pesquise a moto <modelo>\n    Entao deve retorna uma lista com as motos disponiveis\n    Exemplos:\n    |  modelo  |\n    | 'Honda '  |\n    | 'Yamaha' |\n    | 'Kawasaki ' |\n\n  @localizacao_moto\n  Esquema do Cenário: Localizacao do veiculo\n    Quando que eu pesquiso um modelo da marca \"Yamaha\"\n    E faço a busca pela região de <localizacao>\n    Entao vejo a lista de motos disponível na região de <localizacao>\n    Exemplos:\n    | localizacao      |\n    | 'Guarulhos'      |\n    | 'Ribeirão Preto' |\n    | 'Osasco'         |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/pesquisar_veiculo.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @tudo\nFuncionalidade: Webmotors Web\n  Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para encontrar os meus futuros veículos, entrando em contato com os vendedores ou consultar preços\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @pesquisar_veiculo\n  Esquema do Cenário: Pesquisa veiculo\n    Quando que eu pesquise o veiculo \"<modelo>\"\n    Entao deve retorna uma lista com os veiculos disponiveis\n    Exemplos:\n    | modelo     |\n    | Honda      |\n    | Fiat       |\n    # | Mercedes   |\n    | Volkswagen |\n\n  @detalhes_veiculo\n  Esquema do Cenário: Acessar detalhes de um veiculo\n    Quando que eu pesquise o veiculo \"<modelo>\"\n    E acessar o detalhe de um dos veiculos\n    Entao devo visualizar os detalhes do veiculo\n    Exemplos:\n    | modelo     |\n    | Honda      |\n    | Fiat       |\n    | Volkswagen |\n\n  @localizacao_veiculo\n  Esquema do Cenário: Localizacao do veiculo\n    Quando que eu pesquiso um modelo do tipo \"Honda\"\n    E faço a busca pela região de <localizacao>\n    Entao vejo a lista disponível na região de <localizacao>\n    Exemplos:\n    | localizacao      |\n    | 'Guarulhos'      |\n    | 'Ribeirão Preto' |\n    | 'Osasco'       |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/ultimas_buscas.feature","data":"# encoding: utf-8\n# language: pt\n\n@portal @buscas\nFuncionalidade: Webmotors Web\nComo Usuario\nQuero poder de maneira pratica selecionar as buscas anteriores\nPara facilitar no acesso das pesquisas\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @ultimas_busca\n  Cenário: Localizacao do veiculo\n    Quando que eu pesquiso um modelo do tipo \"Honda Civic\"\n    E retorno a página inicial e seleciono a ultima busca realizada\n    Então vejo a lista de veiculos da ultima busca","mediaType":"text/x.cucumber.gherkin+plain"}},
